import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Events from './pages/Events';
import Register from './pages/Register';
import EventDetails from './components/EventDetails';
import Checkout from './components/Checkout';
import Contact from './pages/Contact';  // Importe o componente de Contato
import Produtor from './pages/Produtor'; // Caminho para o componente Produtor
import ProducerDashboard from './pages/ProducerDashboard'; // Corrigido o caminho para o componente ProducerDashboard




const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/events" element={<Events />} />
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Events />} />
        {/* Rota para os detalhes do evento */}
        <Route path="/event/:eventId" element={<EventDetails />} />
        <Route path="/checkout" element={<Checkout />} />
        <Route path="/contact" element={<Contact />} /> {/* PÃ¡gina de Contato */}
        <Route path="/create-event" element={<Produtor />} />
        <Route path="/producer-dashboard" element={<ProducerDashboard />} />
        <Route path="/produtor/:id" element={<Events/>} />
      </Routes>
    </Router>
  );
};

export default App;
